import { TwitterTimelineEmbed } from "react-twitter-embed";


const Thread = () => {
    return (
        <>

    <section className="twitterContainer">
      <div className="twitter-embed">
        <TwitterTimelineEmbed
          sourceType="url"
          url="https://twitter.com/Pecan_Breezy/timelines/1205542982310596608"
          options={{
            tweetLimit: "none",
            width: "100%",
            height: "100%"
          }}
          theme="dark"
          noHeader="true"
          noBorders="true"
          noFooter="true"
        ></TwitterTimelineEmbed>
      </div>
    </section>

};

        </>
    )
}

export default Thread;



